import { useState } from 'react';
import './App.css';
import Login from './components/Login';

function App() {

  const [l, setL] = useState(false);

  const login = ()=>{
    setL(true);
  }

  return (
    <div className="App">
        <h1>Welcome !!!</h1>
        <h3 onClick={login}>Login here</h3>
        <Login login={l}/>
    </div>
  );
}

export default App;
